import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {BrowserRouter, Router} from "react-router-dom";

ReactDOM.render(
  <React.StrictMode>
      <BrowserRouter>
          <Router history={hash}>
              <App />
          </Router>
      </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
